import React from "react";
import { useState } from "react";

const Store = () => {
  const configData = {
    personal_details: {
      text: "",
      settings: {
        fontSize: "text-sm",
      },
    },
  };

  const [data, setData] = useState(configData);

  const templateSettings = {
    data: data,
    setData,
  };
  const AppContext = React.createContext(templateSettings);
  return AppContext;
};

export default Store;
